'use strict';var FormData=require('../FormData');describe('FormData',function(){var formData;beforeEach(function(){formData=new FormData();});afterEach(function(){formData=null;});it('should return non blob null',function(){formData.append('null',null);var expectedPart={string:'null',headers:{'content-disposition':'form-data; name="null"'},fieldName:'null'};expect(formData.getParts()[0]).toMatchObject(expectedPart);});it('should return blob',function(){formData.append('photo',{uri:'arbitrary/path',type:'image/jpeg',name:'photo.jpg'});var expectedPart={uri:'arbitrary/path',type:'image/jpeg',name:'photo.jpg',headers:{'content-disposition':'form-data; name="photo"; filename="photo.jpg"','content-type':'image/jpeg'},fieldName:'photo'};expect(formData.getParts()[0]).toMatchObject(expectedPart);});it('should return non blob array',function(){formData.append('array',[true,false,undefined,null,{},[],'string',0]);var expectedPart={string:'true,false,,,[object Object],,string,0',headers:{'content-disposition':'form-data; name="array"'},fieldName:'array'};expect(formData.getParts()[0]).toMatchObject(expectedPart);});it('should return values based on the given key',function(){formData.append('username','Chris');formData.append('username','Bob');expect(formData.getAll('username').length).toBe(2);expect(formData.getAll('username')).toMatchObject(['Chris','Bob']);formData.append('photo',{uri:'arbitrary/path',type:'image/jpeg',name:'photo3.jpg'});formData.append('photo',{uri:'arbitrary/path',type:'image/jpeg',name:'photo2.jpg'});var expectedPart={uri:'arbitrary/path',type:'image/jpeg',name:'photo2.jpg'};expect(formData.getAll('photo')[1]).toMatchObject(expectedPart);expect(formData.getAll('file').length).toBe(0);});});